  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0130691 contains raw underway
  meteorological, navigational, optical, physical and time series data logged by the
  Scientific Computer System (SCS) aboard the NOAA Ship Oscar Dyson in the Gulf of
  Alaska from 2015-03-14 to 2015-03-31. Office of Marine and Aviation Operations (OMAO)
  personnel aboard the ship submitted these data and associated metadata to NODC.
  In addition, NODC Accession 0130691 contains supplementary cruise-level metadata,
  which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NODC
  personnel developed the automated process to archive these data under the auspices
  of the NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"license_title\":
